import { initializeApp } from 'firebase/app';
import { getAuth } from 'firebase/auth';
import { getFirestore } from 'firebase/firestore';
import { getAnalytics } from 'firebase/analytics';

// Firebase configuration
const firebaseConfig = {
  apiKey: "AIzaSyCQpvCcJogb_i7SVrXcNo8G8bhLJPRNTu8",
  authDomain: "printcostcal.firebaseapp.com",
  projectId: "printcostcal",
  storageBucket: "printcostcal.firebasestorage.app",
  messagingSenderId: "584797786843",
  appId: "1:584797786843:web:086be7f1ac1cd8801432fe",
  measurementId: "G-N6PTBQ9GVS",
  recaptchaKey: "6Lfe3fYqAAAAAP9_JYgedtB4y0k-KBNWYhcvb7qf"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);

// Initialize services
const auth = getAuth(app);
const db = getFirestore(app);

// Initialize Analytics in web environment only
let analytics = null;
if (typeof window !== 'undefined') {
  analytics = getAnalytics(app);
}

// Initialize reCAPTCHA verifier
const initRecaptcha = (containerId) => {
  if (typeof window !== 'undefined' && !window.recaptchaVerifier) {
    window.recaptchaVerifier = new RecaptchaVerifier(auth, containerId, {
      size: 'invisible',
      callback: () => {},
    });
  }
  return window.recaptchaVerifier;
};

export { auth, db, analytics, initRecaptcha };
export default app;
